/**@jsxImportSource @emotion/react */
import { css } from "@emotion/react";
import React from "react";

import titleStyle from "./Styles/titleStyle";

interface Props {
  title: string;
}

const PageTitle = ({ title }: Props) => {
  return (
    <div
      css={css`
        font-size: 15px;
        font-weight: bold;
        margin: 10px 0 5px;
        text-align: center;
        text-transform: uppercase;
      `}
    >
      {title}
    </div>
  );
};

export default PageTitle;
